    SalesRepComponent.prototype.genarateIdNormal = function (oldId) {
        //let year = (new Date()).getFullYear();
        var type = 'MSR';
        var id;
        var newId;
        // let genaratedId;
        if (oldId == null) {
            id = '000001';
            this.genaratedId = type + '-' + id;
        }
        else {
            var fullid = oldId.split('-');
            id = parseInt(fullid[1]);
            id++;
            if (id > 9999) {
                newId = "0" + id;
            }
            else if (id > 999) {
                newId = "00" + id;
            }
            else if (id > 99) {
                newId = "000" + id;
            }
            else if (id > 9) {
                newId = "0000" + id;
            }
            else if (id > 0) {
                newId = "00000" + id;
            }
            this.genaratedId = type + '-' + newId;
        }
        // this.newGenaratedId = genaratedId;
        console.log('next Id =' + this.genaratedId);
        this.myForm.patchValue({ genaratedId: this.genaratedId });
    };
