        var type = 'SUP';
        var id;
        var newId;
        var genaratedId;
        if (oldId == null) {
            id = '000001';
            genaratedId = type + '-' + id;
        }
        else {
            var fullid = oldId.split('-');
            id = parseInt(fullid[1]);
            id++;
            if (id > 9999) {
                newId = "0" + id;
            }
            else if (id > 999) {
                newId = "00" + id;
            }
            else if (id > 99) {
                newId = "000" + id;
            }
            else if (id > 9) {
                newId = "0000" + id;
            }
            else if (id > 0) {
                newId = "00000" + id;
            }
            genaratedId = type + '-' + newId;
        }
        this.newGenaratedId = genaratedId;
        console.log('next Id =' + genaratedId);
        this.myForm.patchValue({ genaratedId: genaratedId });
